.care_button_sec .elementor-widget-container{
    text-align: right;
}
.care_button{
    color: #FFF;
    border: 1px solid;
    border-color: #959697;
    padding: 22px 80px;
    font-size: 20px;
    font-family: Roboto;
    font-weight: 700;
    text-transform: uppercase;
    letter-spacing: 2px;
    position: relative;
    overflow: hidden;
}
.care_button:hover,
.care_button:focus{
    background: transparent;
    outline: none;
    color: #000;
}

.care_button .care_bg{
    transition: 0.3s;
    width: 100%;
    height: 100px;
    position: absolute;
    background: #959697;
    z-index: -1;
    top: 0;
    left: 0;
}

    .marquee_item {
  height: 70px;
  width: 100%;
  overflow: hidden;
  position: relative;
}

.marquee_item div {
  display: inline;
  width: 280%;
  height: 70px;
  position: absolute;
  overflow: hidden;
    transition: 5s;
}
.marquee_item.long div {
  display: inline;
  width: 320%;
  height: 70px;
  position: absolute;
  overflow: hidden;
    transition: 5s;
}
.marquee_item div.animate{
    animation: marquee 5s linear infinite;
}
.marquee_item div.deactive{
    animation: resetmarquee 0.5s linear;
}

.marquee_item.long div.animate{
    animation: marqueel 5s linear infinite;
}
.marquee_item.long div.deactive{
    animation: resetmarqueel 0.5s linear;
}

.marquee_item span {
  float: left;
  width: 50%;
  font-size: 70px;
  font-family: prate;
  margin-top: -20px;
  text-transform: uppercase;
  color: #FFF;
}

@-webkit-keyframes marquee {
  0% { left: 0; }
  100% { left: -140%; }
}

@keyframes marquee {
  0% { left: 0; }
  100% { left: -140%; }
}

@keyframes resetmarquee {
  0% { left: -50%; }
  100% { left: 0; }
}

@keyframes marqueel {
  0% { left: 0; }
  100% { left: -160%; }
}

@keyframes resetmarqueel {
  0% { left: -50%; }
  100% { left: 0; }
}

